import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import { books } from './services/books';

class App extends Component {

  state = { descriptions: [] };

  componentDidMount() {
    this.setState({ descriptions: this.books.authors });
    console.log("STATE: ", this.state);
  }

  render() {
    return (
      <div className="App">
        <div className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h2>Hello from the Tragic Cavern!</h2>
        </div>   
        <p>{"BOOKS: ", this.state.descriptions}</p>       
      </div>
    );
  }
}

export default App;
